import React, {useState} from "react";
import Clock from 'react-digital-clock';
import Countdown from 'react-countdown';

const ToDoList = () =>{

  
    
    return (
        <>
        <div style = {{ marginBottom : "20px" }} className="main_box">

        
            <Clock />

            <Countdown date={Date.now()} />
        
        </div>
        </>            
    );

};

export default ToDoList;
